Defendant Charles Edward Patterson in court with attorney Terese M. Dick.  Defendant Charles Edward Patterson in custody.  Joanne L Hardtke appeared for the State of Wisconsin.
Sentencing proceeded.  Statements by the State, defense and defendant. 

The Court imposed the following sentence:  AS TO COUNT #1:  The Defendant's TOTAL LENGTH OF SENTENCE shall be SIX (6) years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for THREE (3) years with credit for  203 days time served.  Defendant shall serve THREE (3) years on EXTENDED SUPERVISION.  

The defendant is not eligible for the Challenge Incarceration Program.
The defendant is not eligible for the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens to ensure compliance;
 - Pay restitution in the amount of $1,530 to victim, Salvation Army.  This is to be paid BEFORE surcharges, costs and disbursments.
 - Pay the DNA surcharge, costs and disbursements AFTER restitution is paid.   Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.  If not paid, will convert to a civil judgment.

Filed,
